/**
 * Example interval
 * @constructor
 */
function Dummy() {
    this.instance.end(null, 'I ran!');
}

/**
 * Is the interval active?
 * @type {boolean}
 */
Dummy.active = true;

/**
 * Max instances running in parallel
 * @type {number}
 */
Dummy.instances = 1;

/**
 * Optional schedule method
 * @return {boolean}
 */
Dummy.schedule = function() {
    return true;
};

/**
 * Exports
 */
exports = module.exports = Dummy;
